import * as React from 'react';
import { styled } from '@mui/material/styles';
import './About.css'

const Div = styled('div')(({ theme }) => ({

    ...theme.typography.button,
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(1),
    fontSize: "3em",
    fontFamily: "'Source Sans Pro', 'sans-serif'"
}));

const Dive = styled('div')(({ theme }) => ({

    ...theme.typography.button,
    backgroundColor: theme.palette.background.paper,
    fontSize: "1em",
    fontFamily: "'Source Sans Pro', 'sans-serif'"
}));

function About() {

    return (
        <div className="container" >
            <Div>Hi, I'm Austin Barton</Div>
            <Dive>Im a product designer based in Sydney, Australia with experience in delivering end-to-end UX/UI design for software products. {"\n"} Im passionate about improving the lives of others through design and am constantly looking to learn new things everyday.</Dive>
        </div>
    );
}
export default About;
